import React, {createContext} from "react";
import Header from "../../widgets/Header/Header";
import { IHome } from "../../app/models/models";


export function HomePage(props:IHome){
	
	const value:boolean = props.isChecked;
	const isAuthContext = createContext(value);

	return (
		<div className="Home">
			<isAuthContext.Provider value>
				<Header/>
			</isAuthContext.Provider>
		</div>
	);
}
